import React from "react";
import styles from "../styles/index.module.css";
const Introtext = () => {
  return (
    <div>
      Hi, I'm
      <i>
        <b>/Niels/</b>
      </i>
      ,
      <br />
      And I've recently decided to start my career in the tech space. Currently
      I'm building up my skillset at the
      <b>
        <i>Northcoders Developer Pathway</i>
      </b>
      in
      <i>
        <b>Manchester</b>
      </i>
      . Read more about my starting experience on /my blog/.
      {/* </span> */}
    </div>
  );
};

export default Introtext;
